import React from "react";
import "./InputField.css";

function InputField(props)
{
    return(
             <input 
            type={props.type} 
            style={{
                width:props.width,
                height: props.height,
                fontSize: props.fontSize
            }}
            placeholder={props.placeholder}></input>
      
       
    );
}

export default InputField;
